import React, { Suspense } from "react"
import ReactDOM from "react-dom"
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Outlet,
} from "react-router-dom"
import * as serviceWorker from "./serviceWorker"
import { ToastContainer } from "react-toastify"
import "mdb-react-ui-kit/dist/css/mdb.min.css"
import "@fortawesome/fontawesome-free/css/all.min.css"
import "./index.css"
import "./libs/css/gradientBg.css"
import "./libs/css/Animate.min.css"

import { MDBContainer } from "mdb-react-ui-kit"
const WheelMng = React.lazy(() => import("./App"))
const WidgetPage = React.lazy(() => import("./Widget"))

window.wait = async (t = 1) => {
  return new Promise((resolve) => setTimeout(() => resolve, t * 1000))
}

window.imageUrlFixing = (url = "") => {
  return url.replace("p16-sign-va.tiktokcdn.com", "p16-va.tiktokcdn.com")
}

window.randomInt = (min = 10, max = 99) =>
  Math.floor(Math.random() * (max - min + 1) + min)

const Loading = () => {
  return <div>Loading</div>
}

const GamesPage = () => {
  return <h5>Games page</h5>
}

const Index = () => {
  return <h5>Home page</h5>
}

const Body = () => {
  return (
    <>
      <Outlet />
      <ToastContainer
        theme="light"
        position="bottom-right"
        toastStyle={{
          fontSize: "14px",
          textAlign: "left",
        }}
        hideProgressBar={false}
      />
      <div id="gradient_bg"></div>
    </>
  )
}

const Main = () => {
  return (
    <MDBContainer className="pt-4" style={{ minHeight: "100vh" }}>
      <Router>
        <Routes>
          <Route path="/" element={<Body />}>
            <Route path="/" element={<Index />} />
            <Route path="games" element={<GamesPage />} />
            <Route
              end
              path="games/wheel-of-fortune"
              element={
                <Suspense fallback={<Loading />}>
                  <WheelMng />
                </Suspense>
              }
            />
          </Route>
          <Route
            path="widget/wheel-of-fortune"
            element={
              <Suspense fallback={<Loading />}>
                <WidgetPage />
              </Suspense>
            }
          ></Route>
          <Route
            path="*"
            element={
              <div className="text-center">
                <h5>ERROR! Page not found</h5>
              </div>
            }
          />
        </Routes>
      </Router>
    </MDBContainer>
  )
}

ReactDOM.render(<Main />, document.getElementById("root"))

serviceWorker.unregister()
